Key Callback The key callback is called when a key is pressed on the key board. The IWindow::Window& argument is the window that called the callback. The IWindow::Key argument is the key that was pressed (e.g. Key::A, Key::B, etc.) The IWindow::InputState argument says if the key was pressed or released. to register a key callback, call window.SetKeyCallback(). Where window is a IWindow::Window. An example of a key callback is: void KeyCallback(IWindow::Window& window, IWindow::Key key, IWindow::InputState state) { std::cout << "Key " << key << " was just " << state << '\n';
} ... window.SetKeyCallback(KeyCallback); Gamepad Connected Callback The gamepad connected callback is called when a gamepad is connected. The IWindow::GamepadID argument is the ID of the gamepad that was connected/disconnected. The bool argument is if the gamepad was connected/disconnected. Connected if true and disconnected if false. to register a gamepad connected callback, call IWindow::Gamepad::SetConnectedCallback(). The callback will be set for every gamepad thats why its static. An example of a gamepad connected callback is: void GamepadConnectedCallback(IWindow::GamepadID gid, bool isConnected) { const char* sConnected = ""; switch (isConnected) { case true: sConnected = "connected"; break; case false: sConnected = "disconnected"; default: break; } std::cout << "Gamepad " << (int)gid << " was " << sConnected << "!\n";
} ... IWindow::Gamepad::SetConnectedCallback(GamepadConnectedCallback);
